using namespace std;

class Solution {
  public:
    string makeFancyString(string s) {
        // Regex is way too slow
        // regex reg("([a-z])\\1{2,}", regex_constants::ECMAScript & regex_constants::optimize);
        // cout << regex_search(s, reg) << endl;
        // return regex_replace(s, reg, "$01$01");

        // Not very performant
        // size_t sLength = s.length();
        // size_t repeats = 1;
        // for (int i = 1; i < sLength; i++) {
        //     if (s[i] != s[i - 1]) {
        //         if (repeats > 2) {
        //             int start = i - repeats + 2;
        //             s.erase(start, repeats - 2);
        //             sLength = s.length();
        //             i = start;
        //         }
        //         repeats = 1;
        //     } else {
        //         repeats++;
        //     }
        // }
        // if (repeats > 2) {
        //     int start = sLength - repeats + 2;
        //     s.erase(start, repeats - 2);
        // }
        // return s;

        // Slightly better performance, still far from the fastest
        size_t sLength = s.length();
        if (sLength < 3) {
            return s;
        }

        size_t repeats = 1;
        for (int i = sLength - 1; i >= 0; i--) {
            if (s[i] != s[i + 1]) {
                if (repeats > 2) {
                    s.erase(i + 3, repeats - 2);
                }
                repeats = 1;
            } else {
                repeats++;
            }
        }
        if (repeats > 2) {
            s.erase(2, repeats - 2);
        }
        return s;
    }
};

struct TestCase {
    string s;
    string expectedOutput;
    string returnedOutput;
};

void print(vector<int> vec) {
    cout << "{";
    for (auto it = vec.begin(); it != vec.end(); it++) {
        cout << *it;
        if (it + 1 != vec.end()) {
            cout << ", ";
        }
    }
    cout << "}";
}

void printFlatten(TestCase test) {
    cout << "Input: " << test.s;
    cout << "\nOutput: " << test.expectedOutput;
    cout << "\n";
}

int main() {
    vector<TestCase> testCases{
        {
            .s = "leeetcode",
            .expectedOutput = "leetcode",
        },
        {
            .s = "aaabaaaa",
            .expectedOutput = "aabaa",
        },
        {
            .s = "aab",
            .expectedOutput = "aab",
        },
        {
            .s = ""
                 "zzzzzzzzzzzzzzzzzzz",
            .expectedOutput = "zz",
        },
    };

    auto start = chrono::system_clock::now();
    for (auto test : testCases) {
        // printFlatten(test);
        Solution solution;
        test.returnedOutput = solution.makeFancyString(test.s);
        if (test.returnedOutput == test.expectedOutput) {
            cout << "\e[32;m  => Pass\n";
        } else {
            cout << "\e[31;m  => Failed : returned " << test.returnedOutput;
            cout << "\n";
        }
        cout << "\e[0;m\n";
    }

    auto end = chrono::system_clock::now();
    auto elapsed = chrono::duration_cast<chrono::milliseconds>(end - start);
    cout << "\nElapsed = " << elapsed.count() << "ms\n";
}
